import React, { Component } from 'react';
import './Maincontent.css';
import { Grid } from '@mui/material';
import Statusbar from '../Statusbar/Statusbar';
class Maincontent extends Component {
    constructor(props) {
        super(props);
    }
    state = {  }
    render() { 
        return ( 
            <div>
                <Grid container>
                    <Grid item xs={2}></Grid>
                    <Grid item xs={6}>
                        <div>
                            <Statusbar/>
                        </div>
                    </Grid>
                    <Grid item xs={2}></Grid>
                    <Grid item xs={2}></Grid>
                    
                </Grid> 
            </div>
         );
    }
}
 
export default Maincontent;
